    "2013-03-16T01:00:39.326925",nt"name": "georgia-well-log-observation-data",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is a compilation of well logs
    provided by the U.S. Geological Survey in cooperation with the Georgia Department
    of Natural Resources, published as an Excel Spreadsheet, a Web Map service, an ESRI
    service, and as a Web Feature service, for the National Geothermal Data System.
    The available downloadable document contains 8 worksheets, including information
    about the template, notes related to revisions of the template, resource provider
    information, the data, a field list (data mapping view) and a worksheet with vocabularies
    for use in populating the spreadsheet (data valid terms). Fields in the data table
    include Well Name, API Number, Ended Drilling Date, Well Type, Bottom Logged Interval,
    and Log Notes.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
